export let review = (num) => {
  let ol = {};
  let vak = 0;
  let li = [];
  let zol = "";
  while (num > vak) {
    li.push(vak + 1);
    vak++;
  }
  let lop = li.map((e, x) => {
    let ad = Math.random().toString().slice(3, 4);
    if (ad <= "5") {
      if (ad < 4 && ad !== 0) ad = 4;
      else ad = ad;
    } else {
      ad = String(Number(ad) - 5);
    }
    ol["profile"] = "Lorem ipsum dolor sit amet, consectetur" + x;
    ol["comment"] =
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc vulputate libero et velit interdum, ac aliquet odio mattis. Class aptent taciti sociosqu ad litora torquent per " +
      x;
    ol["star"] = ad;
    ol["picture"] = smiling;
    zol += "," + JSON.stringify(ol);
  });
  let kol = zol.replace(",", "");
  return `[` + kol + `]`;
};
